import React from 'react'


const divStyle = {
    color: 'blue',
   
  };

function UserList({post}) {
    return (
        <div>
    	
     
		 <div key={post.id} style={divStyle}>{post.id} ,  {post.userRole.name}
         
        </div>
       <br/>
        </div>
    )
}

export default UserList
